import { useState } from "react";
import style from "./registerForm.module.css";
import { useNavigate } from "react-router-dom";

const RegisterForm = () => {
  const navigate = useNavigate();

  const goToLoginForm = () => {
    navigate("/");
  };

  const [login, setLogin] = useState('')
  const [password, setPassword] = useState('')

  const handleRegister = async (e) => {
    e.preventDefault()

    try {
        const response = await fetch('http://localhost:5000/api/register', {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json',
            },
            body: JSON.stringify({login, password})
        })
        const data = await response.json()

        if (response.ok) {
            navigate('/')
        } else {
            alert('Ошибка регистрации')
        }
    } catch (err) {
        console.error(err); 
    }
  }

  return (
    <div>
      <div>Регистрация аккаунта</div>
      <div>
        <div>Войдите в аккаунт если у вас он уже есть</div>
        <button onClick={goToLoginForm}>Войти в аккаунт</button>
      </div>
      <div>
        <div>
          <input type="text" value={login} onChange={(e) => setLogin(e.target.value)} placeholder="Введите логин" />
        </div>
        <div>
          <input type="password" value={password} onChange={(e) => setPassword} placeholder="Введите пароль" />
        </div>
        <button>Регистрация</button>
      </div>
    </div>
  );
};

export default RegisterForm;
